import React, { Component } from 'react';


class Welcome extends Component {

  constructor(props){
      super(props);
  }
    


    render() {
        return (
            <div className="Welcome container bg-success">
               <h2>Welcome </h2> {this.props.username}
            </div>
        );


    }


}





export default Welcome;
